import logo from './logo.svg';
import NameAndSubtitle from './NameAndSubtitle.js'
import './App.css';
import {
  AwesomeButton,
  AwesomeButtonProgress,
  AwesomeButtonSocial,
} from 'react-awesome-button';
import 'react-awesome-button/dist/themes/theme-eric.css';

function App() {
  return (
    <div className="main">
      <div className="image-background"></div>

      <div className="App">
        <div className="title-div">
        <NameAndSubtitle></NameAndSubtitle>
        </div>
        <div className="buttons-div">
        <AwesomeButton type="primary">Download my CV</AwesomeButton>
        <AwesomeButton type="secondary">Send me an email</AwesomeButton>
        </div>
      </div>
    </div>

  );
}

export default App;
